import { useEffect, useState } from "react"
import callTickets from "./api/callTickets"
import Tickets from './tickets/tickets'

let container = {
    width: 119,
    height: 25,
    backgroundColor: '#063b50',
    color: 'white',
    textAlign: 'center',
    paddingTop: 3,
    marginRight: 2,
}

let input = {
    width: 800,
    height: 40
}

function IndexButton({title}) {
    return (
        <div style={container}>
            {title}
        </div>
    )
}


function Input() {
    return (
        <input style={input}></input>
    )
}


export default function LdTickets() {
    const [tickets, setTickets] = useState([]) 

    useEffect(() => {
        const getData = async () => {
            let res = await callTickets()
            setTickets(res.sort((a, b) => b.isd - a.isd))
        }

        getData()
    }, [])

    function renderTickets() {
        return tickets.map((item, i) => (
            <span key={`T${i}`}>
                <Tickets data={item}/>
            </span>
        ))
    }

    function renderIndex() {
        return (
            <span style={{display: 'flex'}}>
                <IndexButton title='Open'/>
                <IndexButton title='Closed'/>
            </span>
        )
    }

    return (
        <span>
            <div style={{margin: '5px 0 0 10px'}}>{renderIndex()}</div>
            <Input/>
            <div>{renderTickets()}</div>
        </span>
    )
}
